import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

import Navbar from "./components/navbar.component"


function App() {
    return (
    <Router>
        <div className="container">
        <Navbar/>
        <br/>

        </div>
    </Router>
    );
}

export default App;
